const secret = bru.getEnvVar("apiSecret");
const uploadedContractNum = bru.getEnvVar("uploadedContractNum");

// Validate required variables
if (!secret) {
    throw new Error('apiSecret environment variable is missing');
}
if (uploadedContractNum === undefined) {
    throw new Error('uploadedContractNum environment variable is missing');
}

// SHA256 function (equivalent to CryptoJS.SHA256)
function SHA256(input) {
    return crypto.createHash('sha256').update(input, 'utf8').digest('hex');
}

// AES ECB encryption with PKCS7 padding
function AESEncrypt(plaintext, keyHex) {
    const keyBuffer = Buffer.from(keyHex, 'hex');
    const blockSize = 16;

    // PKCS7 padding
    const padding = blockSize - (plaintext.length % blockSize);
    const paddedText = plaintext + String.fromCharCode(padding).repeat(padding);

    // AES-256-ECB encryption
    const cipher = crypto.createCipheriv('aes-256-ecb', keyBuffer, null);
    cipher.setAutoPadding(false); // We handle padding manually
    let encrypted = cipher.update(paddedText, 'utf8', 'hex');
    encrypted += cipher.final('hex');

    return {
        ciphertext: encrypted,
        toString: () => encrypted
    };
}

// Define utility functions (equivalent to your Postman util)
