const CryptoJS = {
    SHA256: function(input) {
        const crypto = require('crypto');
        return crypto.createHash('sha256').update(input, 'utf8').digest('hex');
    },
    mode: {
        ECB: 'ECB'
    },
    pad: {
        Pkcs7: 'Pkcs7'
    },
    AES: {
        encrypt: function(plaintext, key, options) {
            const crypto = require('crypto');
            const keyBuffer = Buffer.from(key, 'hex');

            // PKCS7 padding
            const blockSize = 16;
            const padding = blockSize - (plaintext.length % blockSize);
            let paddedText = plaintext + String.fromCharCode(padding).repeat(padding);

            const cipher = crypto.createCipheriv('aes-256-ecb', keyBuffer, null);
            cipher.setAutoPadding(false); // We handle padding manually
            let encrypted = cipher.update(paddedText, 'utf8', 'hex');
            encrypted += cipher.final('hex');

            return {
                ciphertext: { toString: () => encrypted },
                toString: () => encrypted
            };
        },
        decrypt: function(ciphertext, key, options) {
            const crypto = require('crypto');
            const keyBuffer = Buffer.from(key, 'hex');

            const encryptedBuffer = Buffer.from(ciphertext, 'base64');
            const decipher = crypto.createDecipheriv('aes-256-ecb', keyBuffer, null);
            decipher.setAutoPadding(false); // We handle padding manually

            let decrypted = decipher.update(encryptedBuffer);
            decrypted = Buffer.concat([decrypted, decipher.final()]);

            // Remove PKCS7 padding
            const padding = decrypted[decrypted.length - 1];
            if (padding > 0 && padding <= 16) {
                decrypted = decrypted.slice(0, -padding);
            }

            return {
                toString: function(encoding = 'utf8') {
                    if (encoding === 'hex') {
                        return decrypted.toString('hex');
                    }
                    return decrypted.toString('utf8');
                }
            };
        }
    },
    enc: {
        Hex: {
            parse: function(hexString) {
                return Buffer.from(hexString, 'hex');
            }
        },
        Base64: {
            stringify: function(buffer) {
                if (buffer instanceof Buffer) {
                    return buffer.toString('base64');
                }
                return Buffer.from(buffer.toString(), 'hex').toString('base64');
            }
        }
    }
